import React, { useState } from "react";

function Counter() {
  const [car, setCar] = useState(0);
  let inc = () => {
    setCar(car + 1);
  };
  let dec = () => {
    setCar(car - 1);
  };
  return (
    <div>
      <button style={{ 
            background: "Green", 
            borderRadius: "100%", 
            margin: "3px" ,
            border:'0'
        }}>h1>{car}</button>
      <br />
      <button
        style={{
          background: "Orange",
          borderRadius: "100%",
          margin: "3px",
          border: "0",
        }}
        onClick={inc}
      >
        <h1>+</h1>
      </button>
      <button
        style={{
          background: "Green",
          borderRadius: "100%",
          margin: "3px",
          border: "0",
        }}
        onClick={dec}
      >
        <h1>-</h1>
      </button>
    </div>
  );
}

export default Counter;
